import React from 'react';
import logo from './img/Azakana_logo.png';
import Navbar from './components/Navbar/Navbar';

function App() {
  return (
    <div>
      <Navbar />
      <img src={logo} width="75" height="100"/>
    </div>
  );
}

export default App;
